import React from "react";
import "./App.css";

function App() {
  return (
    <div className="container">
      <header className="header">
        <h1>Hydroponic Dashboard System</h1>
      </header>
      <aside className="sidebar">
        <h2>Menu</h2>
        <p>Links and content go here.</p>
      </aside>
      <main className="main">
        <div className="card"></div>
        <div className="card"></div>
        <div className="card"></div>
        <div className="card"></div>
        <div className="card"></div>
        <div className="card"></div>
      </main>
    </div>
  );
}

export default App;
